import Link from 'next/link';

const Index = () => (
  <div>
    <ul>
      <li><Link><a href="/">Home</a></Link></li>
      <li><Link><a href="/about">About</a></Link></li>
    </ul>
    <h1>Welcome to Bitzprice!</h1>
    <p>Keenan Humm</p>
  </div>
)

export default Index;
